import {appConstants} from "../constants/constant";


export const responseReducer = (state = null, action) => {
    switch(action.type) {
        // case appConstants.PUT_APPLICATION:
        //     return action.payload.success ? action.payload : null;
        case appConstants.ACTIVATE:
            console.log("AReducer: "+action.payload.data.success);
            return action.payload.data.success ? action.payload.data.success : null;
        // case appConstants.DE_ACTIVATE:
        //     console.log("DEReducer: "+action.payload.data);
        //     return action.payload.success ? action.payload.data.success : null;
        default:
            return state;
    }
}
